DROP TABLE IF EXISTS indices_dvpt;
DROP TABLE IF EXISTS indicateurs;
DROP TABLE IF EXISTS pays;
DROP TABLE IF EXISTS regions;
CREATE TABLE regions (
    id_region INT PRIMARY KEY AUTO_INCREMENT,
    nom_region TEXT UNIQUE NOT NULL
);

CREATE TABLE pays (
    code_pays VARCHAR(3) PRIMARY KEY,
    nom_pays TEXT NOT NULL,
    id_region INTEGER,
    groupe_revenu TEXT NOT NULL,
    FOREIGN KEY (id_region) REFERENCES regions(id_region)
);
CREATE TABLE indicateurs (
    id INT PRIMARY KEY AUTO_INCREMENT,
    code_pays  CHAR(3) NOT NULL,
    annee INTEGER NOT NULL,
    taux_natalite REAL,
    taux_mortalite REAL,
    consommation_electricite REAL,
    pib REAL,
    pib_par_habitant REAL,
    utilisation_internet REAL,
    mortalite_infantile REAL,
    esperance_vie REAL,
    densite_population REAL,
    taux_chomage REAL,
    FOREIGN KEY (code_pays) REFERENCES pays(code_pays)
);
